import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Switch, Route, Redirect} from 'react-router-dom';

import Nav from './components/nav'


function App() {
  return (
    <Router>
    <div className="App">
      <Nav />
      <Switch></Switch>
    </div>
    </Router>
  );
}

export default App;
